package com.leetcode.java.easy;

import java.util.HashMap;
import java.util.Map;

//242. Valid Anagram Add to List
//Given two strings s and t, write a function to determine if t is an anagram of s.

public class ValidAnagram {
	public boolean isAnagram(String s, String t) {
		char[] firstStringArray = s.toCharArray();
		char[] secondStringArray = t.toCharArray();

		Map<Character, Integer> firstMap = new HashMap<Character, Integer>();
		Map<Character, Integer> secondMap = new HashMap<Character, Integer>();
		for (char key : firstStringArray) {
			if (!firstMap.containsKey(key)) {
				firstMap.put(key, 1);
			} else {
				int temp = firstMap.get(key);
				firstMap.put(key, temp + 1);
			}
		}
		for (char key : secondStringArray) {
			if (!secondMap.containsKey(key)) {
				secondMap.put(key, 1);
			} else {
				int temp = secondMap.get(key);
				secondMap.put(key, temp + 1);
			}
		}

		System.out.println(firstMap);
		System.out.println(secondMap);

		System.out.println(firstMap.equals(secondMap));

		if (firstMap.size() != secondMap.size()) {
			return false;
		}

		if (firstMap.entrySet().equals(secondMap.entrySet())) {
			return true;
		} else {
			return false;
		}

	}

	// main method
	public static void main(String[] args) {
		ValidAnagram callingObject = new ValidAnagram();

		String s = "anagram";
		String t = "naagram";
		boolean output = callingObject.isAnagram(s, t);
		System.out.println(output);

		String s1 = "rat";
		String t1 = "car";
		boolean output1 = callingObject.isAnagram(s1, t1);
		System.out.println(output1);

		String s2 = "";
		String t2 = "";
		boolean output2 = callingObject.isAnagram(s2, t2);
		System.out.println(output2);

	}

}
